import { useEffect } from "react";

export function City() {

    let city = "Desconhecido?";

    useEffect(() => {
        function CityResult(data) {
            if(data.title !== undefined) {
                return city = data.title;
            } else {
                city = "Desconhecido!";
            }
        }
    }, []);

    console.log(data.title);

    return(
    <div>
        <p>{city}</p>
    </div>
    );
}
